import React from 'react'
import { Switch, Route } from "react-router-dom";
import Dashbord from '../pages/Dashbord/Dashbord';


import Userlist from '../pages/userlist/Userlist';
import Adduser from '../pages/userlist/Adduser';
import EditUser from '../pages/userlist/EditUser';
import Error404 from '../pages/errorPage/Error404';
export default function Sidebarcontent() {
    return (



        <div>
            <div style={{
                backgroundImage: `url("/assets/images/bg.jpg")`
            }}>
                Hello World
            </div>
            <Switch>

                <Route exact path='/'><Dashbord /></Route>
                <Route exact path="/userslist"> <Userlist /></Route>
                <Route exact path="/adduser"> <Adduser /></Route>
                <Route exact path="/edituser/:id"><EditUser /></Route>
                <Route component={Error404} />
            </Switch>
        </div>

    )
}
